function EFFECT:Init(data)			if(self:WaterLevel()==3)then		local Splach=EffectData()		Splach:SetOrigin(origin)		Splach:SetNormal(Vector(0,0,1))		Splach:SetScale(100)		util.Effect("WaterSplash",Splach)		return	end		local ply=data:GetEntity()	if not(IsValid(ply)) then return end	local jetpack=ply.AccessoryModel	local pos,ang=jetpack:GetPos(),jetpack:GetAngles()	local origin1,origin2=pos+ang:Right()*14+ang:Up()*15+ang:Forward()*-8,pos+ang:Right()*-14+ang:Up()*15+ang:Forward()*-8	local emitter = ParticleEmitter(origin1)	local col	if ply:GetNWBool("TurboOn") then col=Color(100,100,255) else col=Color(255,255,100) end	if(emitter)then		for i = 0, 50 do					local particle						if i>25 then				particle=emitter:Add("sprites/physg_glow1.vmt",origin2)			else				particle=emitter:Add("sprites/physg_glow1.vmt",origin1)			end			if (particle) then				particle:SetVelocity(ply:GetVelocity()/2-ang:Up()*math.Rand(10,300))								particle:SetLifeTime(0)				particle:SetDieTime(math.Rand(0.1,0.6))								particle:SetColor(col.r,col.g,col.b)						particle:SetStartAlpha(255)				particle:SetEndAlpha(0)				particle:SetStartSize(5)				particle:SetEndSize(0)								particle:SetRoll(math.Rand(-360, 360))				particle:SetRollDelta(math.Rand(-0.21, 0.21))								particle:SetAirResistance(200)								particle:SetGravity(Vector(0,0,-200))				particle:SetLighting(false)				particle:SetCollide(true)				particle:SetBounce(0.9)			end		end		emitter:Finish()	end		local dlight=DynamicLight(self:EntIndex())	local rand=math.Rand(0.75,1)	if(dlight)then		dlight.Pos=origin1		dlight.r=col.r*rand		dlight.g=col.g*rand		dlight.b=col.b*rand		dlight.Brightness=.5		dlight.Size=150		dlight.Decay=100		dlight.DieTime=CurTime()+0.3		dlight.Style=0	endend/*---------------------------------------------------------	EFFECT:Think()---------------------------------------------------------*/function EFFECT:Think()	return falseend/*---------------------------------------------------------	EFFECT:Render()---------------------------------------------------------*/function EFFECT:Render()end